import React, { Component } from 'react';
import { ListItem, ListInfo } from '../style';
import { connect } from 'react-redux';

class List extends Component {
	render() {
		const { list } = this.props;
		return (
			<div>
				{
					list.map((item) => {
						return (
							<ListItem>
								<img 
									className='listPic'
									src='https://upload-images.jianshu.io/upload_images/10055378-d40b131c2455783e.png?imageMogr2/auto-orient/strip|imageView2/1/w/360/h/240'
									alt=''
								/>
								<ListInfo>
									<h3 className='title'>从官网定制和下载Android Things系统</h3>
									<p className='desc'>Android Things系统自2018年5月Release以来，官网的Android Things控制台也趋于稳定，有梯子的同学可以自己在控...</p>
								</ListInfo>
						</ListItem>
						);
					}) 
				}
			</div>
		)
	}
}

const mapState = (state) => ({
	list: state.getIn(['home', 'articleList'])
})

export default connect(mapState)(List);
